import TaskItem from "./TaskItem";

function TaskList({allTasks,toggleComplete}) {
    return (
        <div>
            <ul>
                {allTasks.map((task) => {
                    return <TaskItem title={task.desc} id={task.date} state={task.isComplete} toggleComplete={toggleComplete} />
                }) 
                }
            </ul>
        </div>
    )
}

export default TaskList;
